import '../App.css';
import './Hero.css';
import hero2 from '../images/hero2.jpg';

const Hero = (props) => {
    return (
        <div className="Hero-container">
            <div className="Hero-image" src={hero2}></div>
        </div>
    );
};

export default Hero;
